import React from 'react'
import styled from 'styled-components'

import articleImg from '../assets/article.jpg'

const ArticleContainer = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  height: 300px;
  padding: 20px;
`
const ArticleImg = styled.div`
  background-image: url(${articleImg});
  background-size: 300px 150px;
`




const ArticleSection = () => {
    return(
        <>
          <ArticleContainer>
            <ArticleImg />
            {/* <img alt="kittenhug" className="article-img" src={articleImg} /> */}
            <p>
              Our goal is to help reunite the  lost pets of 
              the world to their rightful families. 
              Help us help you!
            </p>
            <a href="description">Pet Postings</a>
          </ArticleContainer>

        </>
    )
}

export default ArticleSection
